export default function PatchNotes () {
    return (
        <div>
            <h1>Deadlock Patch Notes</h1>

            <p>There would be a list of patch notes here that you can click to go to individual patch notes and see more detailed info</p>
            <ul>
                <li>Patch 1.0 - Initial Release</li>
                <li>Patch 1.1 - Bug Fixes and Improvements</li>
                <li>Patch 1.2 - New Features Added</li>
            </ul>
        </div>
    )
}
